    public static double calculaAlfa() {
        double somaDistancias = 0;
        int numeroDePares = 0;
        for (int i = 0; i < dimensoes.length; i++) {
            for (int j = i + 1; j < dimensoes.length; j++) { // começa com j=i+1 para evitar duplicação e auto-pares
                double distancia = distanciaEuclidiana(dimensoes2[i], dimensoes2[j]);
                somaDistancias += distancia;
                numeroDePares++;
            }
        }
        double alfa = somaDistancias / numeroDePares;
        return alfa;
    }

    public static double distanciaEuclidiana(double ponto1, double ponto2) {
        return Math.abs(ponto1 - ponto2); // A distância euclidiana em 1D é a diferença absoluta
    }
